import React from "react";
import {useParams} from "react-router-dom"

const Detail = () => {
    let {id, title, overview}  = useParams(); 
    return (
        <div>
            <h1>Detail</h1>
            <p>ID :{id}</p>
            <p>Title : {title}</p>
            <p>Overview : {overview}</p>
        </div>
    )
}

export default Detail
